QuestsSorted.NameClass:
ProgressSettings.Initialize();
wManager.Wow.Helpers.Quest.QuesterCurrentContext.CurrentStep = ProgressSettings.CurrentSettings.dwarfHunter - 1;

Logging.Write("[FNV_Quester]: Loading current Quester step " + (ProgressSettings.CurrentSettings.dwarfHunter));

Thread p = new Thread(() =>
{    
ProgressSettings.inProgress = true;
Logging.Write("[FNV_Quester]: Progress saver initialized");
 
 while(robotManager.Products.Products.IsStarted)
 {
if(!ProgressSettings.inProgress)
{
ProgressSettings.Dispose();
Logging.Write("[FNV_Quester]: Progress saver disposed");
break;
}

  if (Conditions.InGameAndConnectedAndAliveAndProductStartedNotInPause)
  {
 if(ProgressSettings.CurrentSettings.dwarfHunter != wManager.Wow.Helpers.Quest.QuesterCurrentContext.CurrentStep)
{
ProgressSettings.CurrentSettings.dwarfHunter = wManager.Wow.Helpers.Quest.QuesterCurrentContext.CurrentStep;
ProgressSettings.CurrentSettings.Save();
}
}

  Thread.Sleep(1000);
 }

});

p.Start();

Lua.LuaDoString("PetDismiss();");

Thread.Sleep(robotManager.Helpful.Others.Random(500, 1500));

Lua.LuaDoString("PetAbandon();");

Thread.Sleep(robotManager.Helpful.Others.Random(500, 1500));

Lua.LuaDoString("ReloadUI();");

Thread.Sleep(robotManager.Helpful.Others.Random(500, 1500));

Logging.Write("[FNV_Quester]: Going to relog, to avoid UI bugs. Hold on... .");

Thread.Sleep(1000);

while(Conditions.InGameAndConnected)
{
Lua.LuaDoString("Logout()");
Thread.Sleep(25000);
}

robotManager.Helpful.Keyboard.DownKey(wManager.Wow.Memory.WowMemory.Memory.WindowHandle, System.Windows.Forms.Keys.Enter);

Thread.Sleep(30000);

